INSERT INTO `products` VALUES (1,2,'Eyelet Curtains','eyelet-curtains','<h3><strong>Eyelet Curtains – Modern Elegance with Effortless Functionality</strong></h3><p>Eyelet curtains, also known as <strong>grommet curtains</strong>, are a popular choice for contemporary interiors due to their sleek, clean lines and practical design. Each panel features <strong>large metal rings (eyelets)</strong> at the top, allowing the curtain to glide smoothly along the rod – no hooks or rings needed.</p><p><br></p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Effortless Installation:</strong> Slide directly onto any standard curtain rod – quick and tool-free setup.</li><li><strong>Smooth Operation:</strong> Eyelets ensure smooth and quiet opening and closing.</li><li><strong>Modern Look:</strong> The uniform pleats and metal ring accents create a crisp, elegant drape.</li><li><strong>Versatile Styling:</strong> Available in a wide range of fabrics, colors, and textures to match any decor – from minimalist to luxurious.</li></ul><p><strong>Best For:</strong></p><ul><li>Living rooms, bedrooms, and lounges</li><li>Homes with a modern or contemporary aesthetic</li><li>Users seeking low-maintenance, stylish window solutions</li></ul><p><strong>Custom Options Available:</strong></p><p>Choose your fabric, lining (standard, blackout, or thermal), and dimensions for a perfect fit.</p>',100.00,100.00,0,0,100,'EYE-EYE-1302','[]','[]','[]','[]',0,'2025-06-02 17:23:27','2025-06-03 15:36:04'),(2,1,'Blackout Curtains','blackout-curtains','<h3><strong>Blackout Curtains – Total Light Control Meets Stylish Comfort</strong></h3><p>Blackout curtains are designed for <strong>maximum privacy and light blocking</strong>, making them the ideal choice for bedrooms, nurseries, home theaters, and any space where <strong>light control and insulation</strong> are essential. These curtains feature a <strong>thick, opaque fabric</strong> that blocks up to 99% of sunlight and UV rays, helping to create a darker, quieter, and cooler environment.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Superior Light Blocking:</strong> Perfect for shift workers, late risers, or those who value complete darkness.</li><li><strong>Energy Efficient:</strong> Helps maintain indoor temperature by reducing heat loss in winter and heat gain in summer.</li><li><strong>Noise Reduction:</strong> The heavy fabric also provides sound-dampening benefits for a more peaceful space.</li><li><strong>Privacy Guaranteed:</strong> No visibility from outside, even at night with lights on.</li><li><strong>Modern Designs:</strong> Available in various colors, textures, and styles – including eyelet, pencil pleat, and wave header.</li></ul><p><strong>Best For:</strong></p><ul><li>Bedrooms, baby rooms, media rooms</li><li>Day sleepers and privacy-conscious users</li><li>Homes in hot climates seeking energy efficiency</li></ul><p><strong>Customization Options:</strong></p><p>Tailor the size, header style, and lining type to suit your room perfectly. Options include <strong>thermal lining</strong>, <strong>double blackout</strong>, or <strong>layered designs</strong> for added luxury.</p>',300.00,250.00,1,1,100,'CUR-BLA-2114','[\"products/01JXA2G0ZF8Q9NRX49FY18DYQ0.jpeg\", \"products/01JXA2G0ZBXA7KNST3WHHPKZ5C.jpeg\"]','[]','[]','[]',0,'2025-06-02 17:26:21','2025-06-09 14:26:17'),(3,1,'Ring Curtains','ring-curtains','<h3><strong>Ring Curtains – Sleek, Functional &amp; Easy to Hang</strong></h3><p><strong>Ring curtains</strong> feature built-in metal rings at the top, allowing them to slide effortlessly along curtain rods. This style offers a <strong>modern, streamlined appearance</strong> and is a favorite for those seeking convenience without compromising on elegance.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Quick Installation:</strong> Integrated rings simply slide onto any standard curtain rod – no hooks or extra hardware needed.</li><li><strong>Smooth Movement:</strong> Curtains open and close with minimal effort, making daily use easy and quiet.</li><li><strong>Contemporary Style:</strong> The ring design creates uniform, soft pleats that hang beautifully in any space.</li><li><strong>Durable Finish:</strong> Stainless steel or powder-coated rings prevent rust and ensure long-lasting performance.</li></ul><p><strong>Available In:</strong></p><ul><li><strong>Light-filtering, thermal, and blackout fabrics</strong></li><li><strong>Variety of textures</strong> – from sheer linen to velvet</li><li><strong>Multiple colors and patterns</strong> to suit any room theme</li></ul><p><strong>Ideal For:</strong></p><ul><li>Living rooms, bedrooms, offices</li><li>Modern and minimalist interiors</li><li>Customers looking for low-maintenance yet stylish curtain options</li></ul>',200.00,200.00,1,1,200,'CUR-RIN-4025','[\"products/01JXA2M8QD1ETJRM9W9NJ9D2XP.jpg\", \"products/01JXA2M8QGM14YMNPZPZ3Q9KEB.jpg\", \"products/01JXA2N1MZGHFMFYQ2GBWZQ4EZ.jpg\"]','[]','[]','[]',0,'2025-06-02 17:28:11','2025-06-09 14:26:35'),(4,4,'Wave Curtains','wave-curtains','<h3><strong>Wave Curtains – Contemporary Elegance with Effortless Flow</strong></h3><p><strong>Wave curtains</strong> are known for their <strong>smooth, flowing folds</strong> that create a soft, ripple-like effect from ceiling to floor. Suspended on a special track system, they offer a minimalist, elegant look ideal for <strong>modern interiors</strong> that value clean lines and seamless style.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Uniform Waves:</strong> The unique header tape and track system form consistent, gentle curves for a sophisticated drape.</li><li><strong>Ceiling-to-Floor Elegance:</strong> Perfect for full-height windows and sliding doors, enhancing vertical space.</li><li><strong>Sleek Track System:</strong> Invisible or low-profile tracks mounted on ceilings or walls create a floating effect.</li><li><strong>Soft &amp; Structured Finish:</strong> Combines the relaxed look of sheer curtains with the polished finish of tailored drapes.</li></ul><p><strong>Best Suited For:</strong></p><ul><li>Luxury living spaces, offices, hotels, and showrooms</li><li>Large windows or glass walls where symmetry and flow matter</li><li>Modern interiors with a minimalistic or architectural style</li></ul><p><strong>Available Options:</strong></p><ul><li><strong>Sheer, dimout, or blackout fabrics</strong></li><li><strong>Custom lengths and wave depths</strong></li><li>Compatible with <strong>motorized or manual wave curtain tracks</strong></li></ul>',300.00,300.00,0,0,300,'WAV-WAV-1952','[]','[]','[]','[]',0,'2025-06-02 17:50:19','2025-06-03 15:36:04'),(5,9,'Roman Blinds','roman-blinds','<h3><strong>Roman Blinds – Timeless Style with Smooth Functionality</strong></h3><p><strong>Roman blinds</strong> offer a refined alternative to traditional curtains, combining the softness of fabric with the clean lines of a blind. When raised, the fabric stacks evenly into horizontal pleats; when lowered, it hangs flat for a sleek and elegant finish.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Elegant Fold Design:</strong> Fabric folds neatly into soft, structured pleats when lifted.</li><li><strong>Custom Fit:</strong> Made-to-measure to suit any window size for a tailored, professional look.</li><li><strong>Fabric Versatility:</strong> Available in sheer, dimout, or blackout materials – ideal for any room lighting needs.</li><li><strong>Space-Saving:</strong> Sits neatly within or outside the window frame – great for smaller rooms or minimal interiors.</li><li><strong>Smooth Mechanism:</strong> Manual or motorized lift systems for easy operation and child safety.</li></ul><p><strong>Perfect For:</strong></p><ul><li>Living rooms, bedrooms, dining areas, and offices</li><li>Layering with curtains for added texture and insulation</li><li>Homes seeking a <strong>classic-meets-modern</strong> window treatment</li></ul><p><strong>Customization Options:</strong></p><ul><li><strong>Fabric textures:</strong> Linen, cotton, velvet, or performance blends</li><li><strong>Lining choices:</strong> Blackout, thermal, or standard</li><li><strong>Control type:</strong> Cord, chain, or remote motorized operation</li></ul>',300.00,33.00,0,1,300,'BLI-ROM-8197','[\"products/01JXA2NZHX91HYR3498NQCE4SE.jpg\", \"products/01JXA2NZHZ55G8HWQR6AR2XZ8A.jpg\", \"products/01JXA2NZJ1A17P5H9KZJQ65A36.jpg\"]','[]','[]','[]',0,'2025-06-02 17:52:04','2025-06-09 14:26:59'),(6,1,'Sheer Curtains','sheer-curtains','<h3><strong>Sheer Curtains – Light, Airy &amp; Effortlessly Elegant</strong></h3><p><strong>Sheer curtains</strong> bring a soft, elegant touch to any room while allowing <strong>natural light to gently filter through</strong>. Made from lightweight, translucent fabrics, they create a bright and open feel without compromising privacy during the day.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Light Filtering:</strong> Softens sunlight to reduce glare while maintaining a bright, natural ambiance.</li><li><strong>Elegant Drape:</strong> Flows beautifully from ceiling to floor, adding texture and movement to your interiors.</li><li><strong>Daytime Privacy:</strong> Blurs outside visibility without blocking your view, perfect for street-facing windows.</li><li><strong>Layer-Friendly:</strong> Pair easily with blackout or dimout curtains for added light control and a layered look.</li><li><strong>Minimal Maintenance:</strong> Easy to clean and wrinkle-resistant fabric options.</li></ul><p><strong>Ideal For:</strong></p><ul><li>Living rooms, lounges, dining areas, and open-plan spaces</li><li>Coastal, bohemian, Scandinavian, or minimal interiors</li><li>Creating soft partitions between areas while keeping spaces visually connected</li></ul><p><strong>Customization Options:</strong></p><ul><li><strong>Fabric types:</strong> Voile, chiffon, linen-blend, or organza</li><li><strong>Header styles:</strong> Eyelet, pinch pleat, pencil pleat, wave</li><li><strong>Color range:</strong> From crisp white and warm neutrals to soft pastels</li></ul>',100.00,100.00,1,1,100,'CUR-SHE-5776','[\"products/01JXA2K78KAX7J7Z7FHV962065.jpg\", \"products/01JXA316KZ899EFGA8TR10JBK2.jpg\", \"products/01JXA316M5Z0XJT150S8PCV097.jpg\", \"products/01JXA316M7MWFD1Z8RBYKN406D.jpg\"]','[]','[]','[]',0,'2025-06-02 17:53:50','2025-06-09 14:27:18'),(7,51,'Wallpaper','51','<h3><strong>Wallpaper – Transform Your Walls with Texture, Color &amp; Character</strong></h3><p><strong>Wallpaper</strong> is a powerful design element that adds depth, personality, and sophistication to any space. From subtle textures to bold prints, it offers endless possibilities to <strong>enhance or completely redefine</strong> the look of a room.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Design Versatility:</strong> Available in countless styles – modern, classic, geometric, floral, metallic, and more.</li><li><strong>Easy Application:</strong> Peel-and-stick, pre-pasted, or traditional paste options to suit your installation needs.</li><li><strong>Durable Finish:</strong> High-quality materials resistant to fading, peeling, and moisture – ideal for long-term use.</li><li><strong>Instant Impact:</strong> A cost-effective way to create feature walls, define spaces, or update outdated interiors.</li></ul><p><strong>Popular Applications:</strong></p><ul><li>Living rooms, bedrooms, offices, cafes, and boutiques</li><li>Accent walls, entryways, or full-room transformations</li><li>Ceilings, furniture panels, or behind shelving for creative detailing</li></ul><p><strong>Available Options:</strong></p><ul><li><strong>Material types:</strong> Vinyl, non-woven, fabric-backed, textured, eco-friendly</li><li><strong>Finish choices:</strong> Matte, satin, gloss, embossed</li><li><strong>Custom printing:</strong> Tailored designs, branding patterns, or mural wallpapers</li></ul>',100.00,100.00,0,0,100,'AFT-51-2376','[]','[]','[]','[]',0,'2025-06-02 17:55:09','2025-06-03 15:36:04'),(8,12,'Vertical Blinds ','vertical-blinds','<h3><strong>Vertical Blinds – Sleek, Practical &amp; Perfect for Light Control</strong></h3><p><strong>Vertical blinds</strong> offer a smart and stylish window treatment ideal for <strong>large windows, sliding doors</strong>, and <strong>commercial spaces</strong>. Their <strong>adjustable vertical slats</strong> provide precise control over light, glare, and privacy, making them a functional choice without sacrificing aesthetics.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Adjustable Light Control:</strong> Tilt the slats to filter light, reduce glare, or achieve full privacy.</li><li><strong>Space-Saving Design:</strong> Slats neatly stack to the side when opened, allowing full window exposure.</li><li><strong>Versatile Application:</strong> Ideal for wide window spans, patio doors, and office partitions.</li><li><strong>Low Maintenance:</strong> Easy-to-clean materials and simple operation – built for everyday use.</li><li><strong>Custom Fit:</strong> Made-to-measure sizes for a clean, tailored look.</li></ul><p><strong>Material Options:</strong></p><ul><li><strong>Fabric, PVC, faux wood, or aluminum slats</strong></li><li><strong>Blackout, light-filtering, or moisture-resistant options</strong> – perfect for kitchens and bathrooms</li></ul><p><strong>Ideal For:</strong></p><ul><li>Homes with <strong>floor-to-ceiling windows</strong> or <strong>balcony doors</strong></li><li>Offices, clinics, schools, or retail spaces</li><li>Anyone needing <strong>functional light control</strong> with a modern finish</li></ul><p><strong>Operation Choices:</strong></p><ul><li><strong>Cord/chain system</strong></li><li><strong>Wand control</strong> for child safety</li><li><strong>Motorized remote control</strong> (optional upgrade)</li></ul>',300.00,111.00,0,0,100,'VER-VER-7603','[]','[]','[]','[]',0,'2025-06-02 17:57:01','2025-06-03 15:36:04'),(9,9,'Venetian Blinds','venetian-blinds','<h3><strong>Venetian Blinds – Classic Style with Precision Light Control</strong></h3><p><strong>Venetian blinds</strong> feature <strong>horizontal slats</strong> that can be tilted, raised, or lowered to give you <strong>total control over light and privacy</strong>. Their timeless design suits both residential and commercial spaces, offering a clean, modern look with practical functionality.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Adjustable Slats:</strong> Tilt to control natural light, reduce glare, or block out views entirely.</li><li><strong>Compact Stacking:</strong> Slats lift and stack neatly at the top for an unobstructed window view.</li><li><strong>Durable Materials:</strong> Available in <strong>aluminum, faux wood, real wood, or PVC</strong> – built to last in any environment.</li><li><strong>Low Maintenance:</strong> Easy to clean with a simple wipe-down – perfect for high-traffic areas.</li></ul><p><strong>Ideal For:</strong></p><ul><li>Kitchens, bathrooms, offices, and modern living spaces</li><li>Small or medium windows needing precise light control</li><li>Interiors requiring a sleek, structured aesthetic</li></ul><p><strong>Customization Options:</strong></p><ul><li><strong>Slat sizes:</strong> 16mm, 25mm, 35mm, or 50mm</li><li><strong>Finish types:</strong> Matte, gloss, woodgrain, or metallic</li><li><strong>Control options:</strong> Corded, wand tilt, or motorized systems</li></ul>',100.00,100.00,1,1,100,'BLI-VEN-8056','[\"products/01JXA2QCH5QM2J49DXR8JXBD93.jpg\", \"products/01JXA2QCH86HZEKN11GDY26PWN.jpg\", \"products/01JXA2QCHANFS050A8BNC19D2N.jpg\"]','[]','[]','[]',0,'2025-06-02 17:58:26','2025-06-09 14:27:38'),(10,9,'Roller blinds','roller-blinds','<h3><strong>Roller Blinds – Sleek, Minimal &amp; Highly Functional</strong></h3><p><strong>Roller blinds</strong> are a clean and contemporary window treatment designed for <strong>efficient light control and space-saving elegance</strong>. Made from a single piece of fabric that rolls up neatly into a compact headrail, they are ideal for both <strong>residential and commercial settings</strong>.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Smooth Operation:</strong> Easy to raise or lower using a chain, spring, or motorized mechanism.</li><li><strong>Minimal Footprint:</strong> Sits flush against the window, making it perfect for small or modern spaces.</li><li><strong>Light Control Options:</strong> Choose from <strong>sheer, dimout, or full blackout fabrics</strong> depending on your room needs.</li><li><strong>Durable &amp; Low Maintenance:</strong> Made from hard-wearing materials that are easy to clean and built to last.</li><li><strong>Custom Fit:</strong> Made-to-measure sizes for a sleek, seamless finish.</li></ul><p><strong>Ideal For:</strong></p><ul><li>Bedrooms, kitchens, bathrooms, offices, and minimalist interiors</li><li>Homes looking for <strong>uncluttered, modern aesthetics</strong></li><li>Spaces needing <strong>blackout</strong> or <strong>UV-filtering</strong> functionality</li></ul><p><strong>Available Options:</strong></p><ul><li><strong>Fabric types:</strong> Sunscreen mesh, polyester, PVC-coated, blackout</li><li><strong>Mounting styles:</strong> Inside or outside recess, ceiling or wall mount</li><li><strong>Operation types:</strong> Manual chain, cordless spring, or motorized remote system</li></ul>',100.00,100.00,0,1,100,'BLI-ROL-6385','[\"products/01JXA2R5TV8FVT3YS0DK7YPPPE.jpg\", \"products/01JXA2R5TXEXNV0PD3C3545TF9.jpg\", \"products/01JXA2R5TY27N441YSJEVWRXM9.jpg\"]','[]','[]','[]',0,'2025-06-02 17:59:59','2025-06-09 14:27:54'),(11,5,'Blackout with Sheer Curtains','blackout-with-sheer-curtains','<h3><strong>Blackout + Sheer Curtains – Dual-Layer Elegance with 24/7 Light Control</strong></h3><p><strong>Blackout with Sheer Curtains</strong> combine the <strong>light-filtering beauty of sheers</strong> with the <strong>privacy and darkness of blackout drapes</strong> in a smart, layered setup. This dual-function design allows you to effortlessly shift between <strong>soft daylight</strong> and <strong>total privacy</strong>, all while adding a rich, designer look to your space.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Two Layers, Total Control:</strong> Use the sheer layer during the day to let in filtered natural light, and the blackout layer at night for full privacy and darkness.</li><li><strong>Flexible Styling:</strong> Hang on a double curtain rod or track for smooth, independent operation of each layer.</li><li><strong>Energy Efficient:</strong> The blackout layer helps insulate your space, reducing heat and noise.</li><li><strong>Elegant Look:</strong> The contrast between soft, airy sheers and heavy blackout fabric adds depth and luxury to any room.</li></ul><p><strong>Ideal For:</strong></p><ul><li>Bedrooms, living rooms, hotel suites, media rooms</li><li>Homes where <strong>style and functionality</strong> are equally important</li><li>Day-to-night spaces needing <strong>versatile light and privacy control</strong></li></ul><p><strong>Customization Options:</strong></p><ul><li><strong>Fabric choices:</strong> Sheer voile, linen-blend, or organza with velvet, thermal, or triple-weave blackout</li><li><strong>Mounting:</strong> Double rods or tracks (ceiling or wall)</li><li><strong>Operation:</strong> Manual pull, wand control, or motorized system</li></ul>',100.00,100.00,0,0,100,'BLA-BLA-4476','[]','[]','[]','[]',0,'2025-06-02 18:01:21','2025-06-03 15:36:04'),(12,53,'Pipe Curtains','pipe-curtains','<h3><strong>Pipe Curtains – Bold Industrial Style with Functional Simplicity</strong></h3><p><strong>Pipe curtains</strong> use <strong>exposed metal pipe rods</strong> as the mounting system, offering a <strong>raw, industrial look</strong> that adds character and strength to any space. Perfect for lofts, cafes, studios, or homes with rustic or contemporary interiors, they blend <strong>durability with bold aesthetics</strong>.</p><p><br></p>','<p><strong>Key Features:</strong></p><ul><li><strong>Industrial Look:</strong> Heavy-duty pipe rods create a rugged, modern feel – ideal for lofts, warehouses, and urban design themes.</li><li><strong>Strong &amp; Durable:</strong> Made from powder-coated or galvanized steel pipes – built to support heavier fabrics and wide spans.</li><li><strong>Custom Mounting:</strong> Ceiling or wall-mounted options available, suitable for unique spaces or extra height.</li><li><strong>Versatile Curtain Compatibility:</strong> Works well with eyelet (ring-top), tab-top, or grommet curtains.</li></ul><p><strong>Ideal For:</strong></p><ul><li>Industrial or rustic-themed homes</li><li>Cafés, studios, showrooms, and creative workspaces</li><li>DIY interiors seeking a bold, standout curtain system</li></ul><p><strong>Customization Options:</strong></p><ul><li><strong>Rod finishes:</strong> Black matte, brushed steel, copper, or antique bronze</li><li><strong>Mount types:</strong> Flange-mounted (wall or ceiling), elbow corners for L-shapes</li><li><strong>Compatible fabrics:</strong> From heavy blackout to sheer linen depending on use</li></ul>',100.00,100.00,0,0,100,'PIP-PIP-2528','[]','[]','[]','[]',0,'2025-06-02 18:03:42','2025-06-03 15:36:04'),(13,9,'Zebra Blinds','zebra-blinds','<p>Zebra blinds offer a sleek modern look with dual-layered fabric that alternates between sheer and solid stripes, allowing precise control of light and privacy. Perfect for both homes and offices, they bring functionality with style.</p>','<ul><li>Dual-layer fabric with alternating sheer and opaque panels</li><li>Smooth chain mechanism for easy light adjustment</li><li>UV-protective and glare-reducing design</li><li>Easy to install and maintain</li><li>Available in manual and motorized options</li></ul><p><br></p>',1111.00,1.00,0,1,11,'BLI-ZEB-3793','[\"products/01JXA3CBW30FECJ1C4M9XE28AM.jpg\", \"products/01JXA3CBW5PATE3AMJQEGCD3B6.jpg\", \"products/01JXA3CBW63WN8SA4CHTQ4Y70H.jpg\"]','[]','[]','[]',0,'2025-06-09 14:22:06','2025-06-09 14:22:06');
